```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?commander ?spouse ?author ?resident
WHERE {
  # Find the commander in a war that is both a disease and a societal event
  ?war dbo:commander ?commander ;
        dbo:isPartOfCategory dbo:Disease ;
        dbo:isPartOfCategory dbo:Societal_event .

  # Find the spouse of a politician who is an office holder
  ?politician dbo:spouse ?spouse ;
              dbo:officeHolder "true" .

  # Identify the author of the book "Hillary Clinton"
  ?author dbo:title "Hillary Clinton" ;
           dbo:genre dbo:Non-fiction .

  # Connect Hillary Clinton to the written work she authored
  ?work dbo:author ?author ;
         dbo:title "Hillary Clinton" .

  # Find the resident of a politician who is an office holder from Chappaqua, New York
  ?resident dbo:residence dbr:Chappaqua,_New_York ;
             dbo:officeHolder "true" .
}
```

