PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?father WHERE {
  # Step 1: Identify Ferdinand III, Holy Roman Emperor
  ?ferdinand3 a dbo:Holy_Roman_Emperor ;
              dbo:birthDate "1583-06-24" ;
              dbo:name "Ferdinand III".

  # Step 2: Find his child
  ?child1 dbo:father ?ferdinand3 ;
            dbo:birthDate ?birthDateChild1 .

  FILTER(?birthDateChild1 > "1583-06-24").

  # Step 3: Determine the father of that child
  ?father a dbo:Person ;
           dbo:child ?child1 .

  # Step 4: Identify Maria Anna of Bavaria (born 1574)
  ?mariaAnna a dbo:Person ;
               dbo:birthDate "1574-02-13" ;
               dbo:name "Maria Anna of Bavaria".

  # Step 5: Find her child
  ?child2 dbo:father ?mariaAnna ;
            dbo:birthDate ?birthDateChild2 .

  FILTER(?birthDateChild2 > "1574-02-13").

  # Step 6: Determine the father of that child
  ?father a dbo:Person ;
           dbo:child ?child2 .

  # Step 7: Ensure that this father is a royalty
  FILTER(?father dbo:title "royalty").
}
