# Find the ruling party in Central, Louisiana
SELECT ?rulingParty WHERE {
  ?state a dbo:State ;
           dbo:name "Louisiana" .
  ?county a dbo:County ;
            dbo:locatedIn ?state ;
            dbo:name "Central" .
  ?party a dbo:PoliticalParty ;
          dbo:rulingPartyOf ?county .
  BIND(?party AS ?rulingParty)
}

# Find the person born as the birth name of Tisha Sterling's parent
SELECT ?person WHERE {
  ?parent dbo:birthName "Tisha Sterling" .
  ?person dbo:birthName ?parentBirthName .
  FILTER(?parentBirthName = "Tisha Sterling")
}
```

