           dbo:deathDate "1881-03-15"^^xsd:date ;
           dbo:title ?title .
  FILTER(?title = dbr:Duke_of_Württemberg)

  ?parent1 dbo:child ?person ;
             dbo:title ?parentTitle1 .
  FILTER(?parentTitle1 = dbr:Aleksander_von_Württemberg)

  ?grandparent dbo:child ?parent1 ;
                dbo:title ?grandparentTitle .
  FILTER(?grandparentTitle = dbr:Archduke_Charles_Louis_of_Austria)

  ?greatGrandparent dbo:child ?grandparent ;
                    dbo:title ?greatGrandparentTitle .
  FILTER(?greatGrandparentTitle = dbr:Aleksander_von_Württemberg)
}
```

